    "/": () => <Read />,
    "/create": () => <Create />,
    "/update": () => <Update />
  };
  const routeResults = useRoutes(routes);
  return (


      <div className="main">
        <h2 className="main-header">React Crud Operations</h2>
        <Nav/>
        {routeResults}

      </div>


  );
}

export default App;
